import React, { Component } from 'react';
import { Route, Redirect } from 'react-router-dom';

export function ProtectedRoute(props) {
  if(!props.loggedIn){
    return <Redirect to="/sign-in" />
  }
  return <Route path={props.path} render={props.render}></Route> 

};
